import React from 'react';

function StudentsList(){
    return (
     <form className="students-list">
         <input type="text"/>
         <input type="number"/>
         <section>
            <option>Wery good</option>
            <option>Good</option>
            <option>Normal</option>
            <option>Bad</option>
         </section>
     </form>
    )
}
export default StudentsList;
